import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "./Clubs.css"; // CSS dosyasını ekliyoruz.

const Clubs = () => {
  const [clubs, setClubs] = useState([]);
  const [filters, setFilters] = useState({
    name: "",
    league: "",
    nation: "",
    manager:"",
  });
  const [currentPage, setCurrentPage] = useState(1);
  const navigate = useNavigate();

  useEffect(() => {
    // Sahte kulüp verileri
    const mockData = Array.from({ length: 50 }, (_, i) => ({
      id: i + 1,
      name: `Club ${i + 1}`,
      league: `League ${i % 5 + 1}`,
      nation: `Country ${i % 10 + 1}`,
      manager: `Manager ${i + 1}`,
      city: `City ${i % 10 + 1}`,
      established: 1900 + (i % 120),
    }));
    setClubs(mockData);
  }, []);

  const handleFilterChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const filteredClubs = clubs.filter((club) =>
    Object.keys(filters).every((key) =>
      filters[key] === "" || club[key]?.toLowerCase().includes(filters[key].toLowerCase())
    )
  );

  return (
    <div className="clubs-container">
      {/* Filtreleme Alanı */}
      <aside className="filters">
        <h3>Filters</h3>
        <div className="filter-input">
          <label>Name</label>
          <input
            type="text"
            name="name"
            value={filters.name}
            onChange={handleFilterChange}
          />
        </div>
        <div className="filter-input">
          <label>League</label>
          <input
            type="text"
            name="league"
            value={filters.league}
            onChange={handleFilterChange}
          />
        </div>
        <div className="filter-input">
          <label>Nation</label>
          <input
            type="text"
            name="nation"
            value={filters.nation}
            onChange={handleFilterChange}
          />
        </div>
        <div className="filter-input">
          <label>Manager</label>
          <input
            type="text"
            name="manager"
            value={filters.manager}
            onChange={handleFilterChange}
          />
        </div>
      </aside>

      {/* Kulüp Listesi */}
      <div className="club-list">
        <h3>Clubs</h3>
        <table className="club-table">
          <thead>
            <tr>
              <th>Name</th>
              <th>League</th>
              <th>Nation</th>
              <th>Manager</th>
            </tr>
          </thead>
          <tbody>
            {filteredClubs.map((club) => (
              <tr
                key={club.id}
                className="club-row"
                onClick={() => navigate(`/clubs/${club.id}`)}
              >
                <td>{club.name}</td>
                <td>{club.league}</td>
                <td>{club.nation}</td>
                <td>{club.manager}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="pagination">
          <button
            className="pagination-btn"
            onClick={goToPreviousGroup}
            disabled={currentPage <= paginationGroupSize}
          >
            &lt;&lt;
          </button>

          {Array.from({ length: endPage - startPage + 1 }, (_, i) => {
            const pageNumber = startPage + i;
            return (
              <button
                key={pageNumber}
                className={`pagination-btn ${currentPage === pageNumber ? "active" : ""
                  }`}
                onClick={() => paginate(pageNumber)}
              >
                {pageNumber}
              </button>
            );
          })}

          <button
            className="pagination-btn"
            onClick={goToNextGroup}
            disabled={startPage + paginationGroupSize > totalPages}
          >
            &gt;&gt;
          </button>
        </div>
    </div>
  );
};

export default Clubs;
